            {user.email}
            </Link>
            <div className="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
              <Link className="dropdown-item" to="/profile">My Profile</Link>
              <button  onClick={handleClick} className="dropdown-item" to="/">Sign Out</button>
            </div>
          </li>
        </ul>

    )}

    </div>
  </nav>

   );
}
 
